  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains the logbook data
  from U.S.A. Commercial Passenger Fishing Vessels (CPFV) fishing in the U.S.A. EEZ
  and in waters off of Baja California, from 1980 to present. These fishing vessels
  carry sport fishermen and target both HMS and non-HMS species. California CPFV operators
  submit mandatory logbooks to the California Department of Fish and Wildlife (CDFW).
  CPFV operators in Washington and Oregon that target albacore submit mandatory logbooks
  to SWFSC since the implementation of the HMS Fisheries Management Plan in 2005.
  Logbook data contain information on locations fished, ports of landing, number of
  anglers, hours fished, species, number of fish kept, and interactions with marine
  mammals.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"temporal-extent-begin\",\n\t\t\"value\":
